import {useState, useEffect} from "react";
import {getData, _Render} from '../api/report';

const handledata=(data)=>{
	let time = []
    let count = []
    for (let i = 0; i< data.length; i++) {
      if (time.length == 0 ){
        time.push(data[i].Buy_Time)
      }
      else {
        let check = false
        for (let j = 0; j < time.length; j++){
          if (data[i].Buy_Time==time[j]){
            check = true
          }
        }
        if (check == false){
          time.push(data[i].Buy_Time)
        }
      }
    }
    console.log(time)
    for (let i = 0; i < time.length; i++){
      let temp = 0
      for (let j = 0; j < data.length; j++){
        if (data[j].Buy_Time == time[i]){
           temp += data[j].Quantity
        }
      }
      count.push(temp)
    }
    console.log(count)
    time.sort();
    const dataout = []
    for (let i = 0; i < count.length; i++){
      let temp = new Date(time[i])
      temp = temp.toLocaleDateString('en-US')
      const obj = {
        Buy_Time: temp,
        Quantity: count[i]
      }
      dataout.push(obj)
    }
    console.log(dataout)
	return dataout;
}

const RenderReport = (checkInDate,checkOutDate,check) => {

	const [data,setData]=useState('')
	if(checkInDate&&checkOutDate){
		_Render(checkInDate,checkOutDate,setData)
	}
	useEffect(()=>{
		getData(setData);

	},[])

    return handledata(data);
}

const SelectData = (checkInDate,checkOutDate)=>{
	let data = _Render(checkInDate,checkOutDate)
	return handledata(data);
}

export {RenderReport, SelectData};
